import * as React from "react";
import Svg, { Path } from "react-native-svg";

function SvgCode(props) {
  return (
    <Svg
      width={24}
      height={24}
      viewBox="0 0 24 24"
      fill="none"
      stroke="currentColor"
      strokeWidth={2}
      strokeLinecap="round"
      strokeLinejoin="round"
      className=""
      {...props}
    >
      <Path d="M16 18l6-6-6-6M8 6l-6 6 6 6" />
    </Svg>
  );
}

export default SvgCode;
